import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./Navbar";
import About from "./About";
import FrontPage from "./FrontPage";
import Home from "./Home";
import LoginHooks from "./components/LoginHooks";
import LogoutHooks from "./components/LogoutHooks";
import "./App.css";
import { GoogleLogin, GoogleLogout } from "react-google-login";
import { response } from "express";

function App() {
  const [isSignedIn, setSignedIn] = useState(false);
  const [data, setData] = useState({});
  const responseGoogle = (response) => {
    console.log(response);
    setData(response.profileObj);
  };
  const logout = () => {
    console.log("logout"); // eslint-disable-line
  };
  const error = (response) => {
    console.error(response); // eslint-disable-line
  };

  const clientId =
    "615520021367-sjvmtmuujlf91gicag6u1kr4b4mu76bq.apps.googleusercontent.com";

  const MountTest = () => {
    const [showButton, toggleShow] = useState(true);

    if (showButton) {
      return (
        <GoogleLogin
          onSuccess={(res) => {
            toggleShow(false);
            success(res);
          }}
          onFailure={error}
          clientId={clientId}
        >
          Auth then Hide button
        </GoogleLogin>
      );
    }

    return <button onClick={() => toggleShow(true)}>show button</button>;
  };

  return (
    <Router>
      <div className="App">
        {<Navbar />}
        <GoogleLogin
          clientId="615520021367-sjvmtmuujlf91gicag6u1kr4b4mu76bq.apps.googleusercontent.com"
          buttonText="Login"
          onSuccess={responseGoogle}
          onFailure={responseGoogle}
          isSignedIn={true}
        />
        <GoogleLogout buttonText="Logout" onLogoutSuccess={logout} />
        <div className="content">
          <Routes>
            <Route exact path="/" element={<Home data={data} />} />
            <Route exact path="/about" element={<About />} />
            <Route exact path="/login" element={<LoginHooks />} />
            <Route exact path="/logout" element={<LogoutHooks />} />
          </Routes>
          <br />
        </div>
      </div>
    </Router>
  );
}

export default App;
